import React from "react";
import { useHistory } from "react-router-dom";
import "../css/Menu.css";

function Menu() {
  const history = useHistory();

  return (
    <div className="menu">
      <div
        onClick={() => {
          history.push("/test");
        }}
        className="menu-card"
      >
        Personality Test
      </div>
    </div>
  );
}

export default Menu;
